'між Сторонами. Сторона, яка вважає свої права порушеними, надсилає іншій Стороні письмову претензію електронною поштою. Строк розгляду претензії – 30 (тридцять) календарних днів з моменту її отримання.' => 'между Сторонами. Сторона, считающая свои права нарушенными, направляет другой Стороне письменную претензию по электронной почте. Срок рассмотрения претензии – 30 (тридцать) календарных дней с момента её получения.',
