'10.2. Сторона, для якої настали форс-мажорні обставини, повинна протягом 5 (п\'яти) календарних днів повідомити іншу Сторону про їх настання та припинення. Неповідомлення або несвоєчасне повідомлення позбавляє Сторону права посилатися на такі обставини як на підставу звільнення від відповідальності.' => '10.2. Сторона, для которой наступили форс-мажорные обстоятельства, должна в течение 5 (пяти) календарных дней уведомить другую Сторону о их наступлении и прекращении. Непредупреждение или несвоевременное уведомление лишает Сторону права ссылаться на такие обстоятельства как на основание освобождения от ответственности.',
'10.3. Якщо форс-мажорні обставини тривають понад 3 (три) місяці, кожна зі Сторін має право розірвати Договір в односторонньому порядку, повідомивши про це іншу Сторону.' => '10.3. Если форс-мажорные обстоятельства продолжаются более 3 (трех) месяцев, каждая из Сторон имеет право расторгнуть Соглашение в одностороннем порядке, уведомив об этом другую Сторону.',
'11. Чинність окремих положень (Автономність положень)' => '11. Действие отдельных положений (Самостоятельность положений)',
