' становить повну домовленість між Сторонами щодо предмету Договору та замінює всі попередні усні та письмові домовленості, заяви та гарантії між Сторонами щодо такого предмету.' => 'составляет полное соглашение между Сторонами относительно предмета Соглашения и заменяет все предыдущие устные и письменные соглашения, заявления и гарантии между Сторонами относительно такого предмета.',
'13. Застосовне право' => '13. Применимое право',
