'14.3. Компанія має право в будь-який час в односторонньому порядку вносити зміни та доповнення до цього Договору та його невід\'ємних частин. Такі зміни набирають чинності з моменту їх публікації на Веб-сайті, якщо інший строк набрання чинності не визначений додатково при їх публікації. Користувач зобов\'язаний самостійно регулярно перевіряти наявність змін до Договору. Продовження використання Веб-сайту Користувачем після внесення змін та/або доповнень до Договору означає повну та беззастережну згоду Користувача з такими змінами та/або доповненнями.' => '14.3. Компания имеет право в любой момент в одностороннем порядке вносить изменения и дополнения в настоящее Соглашение и его неотъемлемые части. Такие изменения вступают в силу с момента их публикации на Веб-сайте, если другой срок вступления в силу не определен дополнительно при их публикации. Пользователь обязуется самостоятельно регулярно проверять наличие изменений в Соглашении. Продолжение использования Веб-сайта Пользователем после внесения изменений и/или дополнений в Соглашение означает полное и безоговорочное согласие Пользователя с такими изменениями и/или дополнениями.',
